      <text id="141" justification="0" size="4" underlined="false">
        <text>This method identifies references from class files
to other class files, attempting to read input like
statements from .class files
(which have no import information).
This method must NOT stack overflow on
circular class references.
&lt;/br&gt;
By the time this monster method returns;
1) All refereced classes from c are loaded from disk, 
   and stored as byte [] instances in the classLoader.
2) All referenced classes from c have their names in 
   the List&amp;lt;String&amp;gt; returned.
3) All classes in the return list have I_ClassReferences
  stored in the refMap of the ClassReferencesDiscovery 
  instance, so they can be looked up later.
</text>
      </text>
